import { Matrix } from "../structures/Matrix";
import { RationalNumber } from "../structures/RationalNumber";

function imageDataToRGBA(imageData: ImageData): [Matrix, Matrix, Matrix, Matrix] {
	const imgR: Matrix = new Matrix(imageData.width, imageData.height);
	const imgG: Matrix = new Matrix(imageData.width, imageData.height);
	const imgB: Matrix = new Matrix(imageData.width, imageData.height);
	const imgA: Matrix = new Matrix(imageData.width, imageData.height);
	let idx: number = 0;
	for (let x: number = 0; x < imageData.width; x++ ) {
		imgR[x] = []; imgG[x] = []; imgB[x] = []; imgA[x] = [];
		for (let y: number = 0; y < imageData.height; y++) {
			imgR.elements[x][y] = new RationalNumber(imageData.data[idx++]);
			imgG.elements[x][y] = new RationalNumber(imageData.data[idx++]);
			imgB.elements[x][y] = new RationalNumber(imageData.data[idx++]);
			imgA.elements[x][y] = new RationalNumber(imageData.data[idx++]);
		}
	}
	return [imgR, imgG, imgB, imgA];
}
function imageDataFromRGBA(rgba: [Matrix, Matrix, Matrix, Matrix]): ImageData {
	const imgR: Matrix = rgba[0];
	const imgG: Matrix = rgba[1];
	const imgB: Matrix = rgba[2];
	const imgA: Matrix = rgba[3];
	const width: number = imgR.m;
	const height: number = imgR.n;
	const imageData: ImageData = new ImageData(width, height);
	let idx: number = 0;
	for (let x: number = 0; x < width; x++ ) {
		for (let y: number = 0; y < height; y++) {
			imageData.data[idx++] = imgR.elements[x][y].toNumber();
			imageData.data[idx++] = imgG.elements[x][y].toNumber();
			imageData.data[idx++] = imgB.elements[x][y].toNumber();
			imageData.data[idx++] = imgA.elements[x][y].toNumber();
		}
	}
	return imageData;
}

$(document).ready(() => {
	const canvas1: HTMLCanvasElement = $("#canvas1")[0] as HTMLCanvasElement;
	const ctx1: CanvasRenderingContext2D = canvas1.getContext("2d");
	const image: HTMLImageElement = new Image();
	image.onload = () => {
		canvas1.height = image.height;
		canvas1.width = image.width;
		ctx1.drawImage(image, 0, 0);
		const imgData1: ImageData = ctx1.getImageData(0, 0, image.width, image.height);
		const rgba = imageDataToRGBA(imgData1);
		// duplicate
		const imgData2: ImageData = imageDataFromRGBA(rgba);
		const canvas2: HTMLCanvasElement = $("#canvas2")[0] as HTMLCanvasElement;
		const ctx2: CanvasRenderingContext2D = canvas2.getContext("2d");
		canvas2.height = imgData2.height;
		canvas2.width = imgData2.width;
		ctx2.putImageData(imgData2, 0, 0);
		// convolute
		const canvas3: HTMLCanvasElement = $("#canvas3")[0] as HTMLCanvasElement;
		const ctx3: CanvasRenderingContext2D = canvas3.getContext("2d");
		const kernel: Matrix = new Matrix(3, 3);
		/*kernel.elements[0][0] = new RationalNumber(-1);
		kernel.elements[0][1] = new RationalNumber(-1);
		kernel.elements[0][2] = new RationalNumber(-1);
		kernel.elements[1][0] = new RationalNumber(-1);
		kernel.elements[1][1] = new RationalNumber(8);
		kernel.elements[1][2] = new RationalNumber(-1);
		kernel.elements[2][0] = new RationalNumber(-1);
		kernel.elements[2][1] = new RationalNumber(-1);
		kernel.elements[2][2] = new RationalNumber(-1);*/
		kernel.elements[0][0] = new RationalNumber(0);
		kernel.elements[0][1] = new RationalNumber(0);
		kernel.elements[0][2] = new RationalNumber(0);
		kernel.elements[1][0] = new RationalNumber(0);
		kernel.elements[1][1] = new RationalNumber(1);
		kernel.elements[1][2] = new RationalNumber(0);
		kernel.elements[2][0] = new RationalNumber(0);
		kernel.elements[2][1] = new RationalNumber(0);
		kernel.elements[2][2] = new RationalNumber(0);
		const newRgba: [Matrix, Matrix, Matrix, Matrix] = [rgba[0].convolute(kernel), rgba[1].convolute(kernel), rgba[2].convolute(kernel), rgba[3].convolute(kernel)];
		const imgData3: ImageData = imageDataFromRGBA(newRgba);
		canvas3.height = imgData3.height;
		canvas3.width = imgData3.width;
		ctx3.putImageData(imgData3, 0, 0);
	};
	image.src = "data:image/png;base64," + encodedImg;

	// Other ways of doing it
	const imgSrc: string = $("#imgSource").attr("src").replace("data:image/png;base64,", "");
	const binSrc: string = atob(imgSrc);
	const img = Uint8Array.from(binSrc, (c) => c.charCodeAt(0));
	// reverse
	let binDest: string = "";
	for (const i of img) {
		binDest += String.fromCharCode(i);
	}
	// String.fromCharCode.apply(null, img); // throww "Maximum call stack size exceeded"
	const imgDest = btoa(binDest);
	$("#imgDestination").attr("src", "data:image/png;base64," + imgDest);

});

